import logo from '../../assets/investment-calculator-logo.png';
import React from 'react';
import './Header.scss';
const Header = () => {
    return (   <header className="header">
            <img src={logo} alt="logo" />
            <h1>Investment Calculator</h1>
        </header>);
};
export default Header;
